import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import {BrowserRouter} from "react-router-dom";
import {ContextProvider} from "./context";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <ContextProvider>
          <BrowserRouter>
              <App />
          </BrowserRouter>
      </ContextProvider>
  </React.StrictMode>
);
